import React from 'react'
import '../styles/navOptions.css'
import NavCard from './NavCard.js'

const NavbarOptions = ({ miPhones,
    redmiPhones,
    tv,
    laptops,
    fitness,
    home,
    audio,
    accessories }) => {
    return (
        <div className="navOptions">

            {
                miPhonesToggle ? miPhones.map((item, index) => (
                    <NavCard key={index} name={item.name} price={item.price} image={item.image} />
                )) : null
            }

            {
                redmiPhones ? redmiPhones.map((item, index) => (
                    <NavCard key={index} name={item.name} price={item.price} image={item.image} />
                )) : null
            }

            {
                tv ? tv.map((item, index) => (
                    <NavCard key={index} name={item.name} price={item.price} image={item.image} />
                )) : null
            }

            {
                laptops ? laptops.map((item, index) => (
                    <NavCard key={index} name={item.name} price={item.price} image={item.image} />
                )) : null
            }

            {
                fitness ? fitness.map((item, index) => (
                    <NavCard key={index} name={item.name} price={item.price} image={item.image} />
                )) : null
            }

            {
                home ? home.map((item, index) => (
                    <NavCard key={index} name={item.name} price={item.price} image={item.image} />
                )) : null
            }

            {
                audio ? audio.map((item, index) => (
                    <NavCard key={index} name={item.name} price={item.price} image={item.image} />
                )) : null
            }

            {
                accessories ? accessories.map((item, index) => (
                    <NavCard key={index} name={item.name} price={item.price} image={item.image} />
                )) : null
            }

        </div>
    )
}

export default NavbarOptions
